import React, { useEffect } from "react";
import { db } from "../utils/config";
import {
  collection,
  getDoc,
  addDoc,
  updateDoc,
  doc,
  arrayUnion,
  arrayRemove,
} from "firebase/firestore";

function SendTestData() {
  useEffect(() => {
    const testDataSend = async () => {
      let data = {
        s1: {
          pnl: 6000,
          detail: {
            noOfTrade: 5,
            trade1: {
              scripName: "Nifty",
            },
          },
        },
      };
      console.log(data);
      // for (let i = 0; i < 5; i++) {
      //   data.push(data[i]);
      // }

      const testingSendingData = doc(db, "users", "devscryptcomp@gmail.com");
      // await updateDoc(testingSendingData, { strategyTags: arrayUnion(data) });
      await updateDoc(testingSendingData, {});
    };
    testDataSend();
  }, []);
  return <div></div>;
}

export default SendTestData;
